```import "./App.css";
import { Contacts } from "./contacts.json";

function App() {
  const [contacts, setContacts] = useState(Contacts.slice(0, 6));

  return (
    &lt;div className="App"&gt;
      &lt;table&gt;
        &lt;ul&gt;
          {contacts.map((contact) =&gt; (
            &lt;li&gt;
              &lt;img src={contact.pictureURL}&gt;&lt;/img&gt;
            &lt;/li&gt;
          ))}
        &lt;/ul&gt;
      &lt;/table&gt;
    &lt;/div&gt;
  );
}```

